import React from 'react';
import ISLogo from "/Users/rick/Git/EcoTrackFront-End/ecotrack-frontend/src/img/infosyslogo.png";
import { makeStyles } from '@mui/styles';

const footerStyle = makeStyles({
    footer: {
        display: 'absolute',
        position: 'absolute',
        bottom: '0px',
        margin: 'auto',
        textAlign: 'center',
        width: '100%',
        backgroundColor: '#F1F2ED'
    }
})

export default function footer() {
    const classes = footerStyle();
  return (
    <div className={classes.footer}>   
        <img src={ISLogo} alt='infoysys' max-width= '10px'/>
    </div>

  )
}
